PROCEDURE PRC_GET_TAREAS(
X_CURSOR OUT SYS_REFCURSOR)
IS
BEGIN
OPEN X_CURSOR FOR
SELECT ID_TAREA,ID_TIPO_TAREA 
FROM TAREAS
WHERE ESTADO = 2;
END PRC_GET_TAREAS;

--Procedimiento para obtener tarea de Purificacion
PROCEDURE PRC_GET_TAREA_PURIFICACION
(
X_CURSOR OUT SYS_REFCURSOR
)
IS
BEGIN
OPEN X_CURSOR FOR 
SELECT
pur.id_purificador, pur.usuario, pur.usuarios, pur.pk_mlogin,pur.agresividad,lg.pass 
FROM purificador PUR
INNER JOIN mlogin LG ON PUR.PK_MLOGIN = LG.PK
WHERE(LG.SUBSCRIPCION = 1 or lg.flg_pp = 1) AND lg.FLG_PUR = 1; 
END PRC_GET_TAREA_PURIFICACION;

--Obtener Reportes de los Mensajes Enviados a los usuarios
PROCEDURE PRC_GET_REPORES_MSJ(
X_CLIENTE_ID IN NUMBER,
X_CURSOR OUT SYS_REFCURSOR)
IS
BEGIN
OPEN X_CURSOR FOR 
SELECT RE.THREAD_ID,RE.ITEM_ID,RE.PK_MLOGIN,RE.CANT_TOTAL,RE.CANT_ENV,RE.CANT_VISTOS,RE.CANT_REACC,RE.LIST_IDS
FROM REPORT_MESS RE 
WHERE 
RE.PK_MLOGIN = X_CLIENTE_ID;
END PRC_GET_REPORES_MSJ;

--Obtener Tarea MassSending para enviar los mensajes a una lista de usuarios
PROCEDURE PRC_GET_MASS_SENDING(
X_CURSOR OUT SYS_REFCURSOR)
IS

BEGIN
OPEN X_CURSOR FOR 
SELECT mas.idmassending, mas.PK_mlogin, mas.usuarios, mas.texto, mas.flg_act, mas.resultado, mas.fecha_inicio, mas.fecha_fin,mas.cliente
FROM MASSENDING MAS
INNER JOIN mlogin LG ON mas.pk_mlogin = LG.PK
WHERE(LG.SUBSCRIPCION = 1 or lg.flg_pp = 1) AND lg.flg_mm = 1 and mas.flg_act=1 and (mas.fecha_inicio <= sysdate and mas.fecha_fin >= sysdate);

END PRC_GET_MASS_SENDING;

PROCEDURE PRC_GET_MASS_SENDING_ID(
X_ID apiinst.massending.idmassending%TYPE,
X_CURSOR OUT SYS_REFCURSOR)
 
IS
BEGIN
OPEN X_CURSOR FOR 
SELECT MAS.idmassending, MAS.PK_mlogin, MAS.usuarios, MAS.texto, MAS.flg_act, MAS.resultado, MAS.fecha_inicio, MAS.fecha_fin,MAS.cliente
FROM MASSENDING MAS WHERE MAS.IDMASSENDING = X_ID;

END PRC_GET_MASS_SENDING_ID;

PROCEDURE PRC_GET_TAREAS_EXPANCION (
X_CURSOR OUT SYS_REFCURSOR
)
IS
BEGIN
OPEN X_CURSOR FOR
SELECT MT.ID_METHODLIKE,mt.velocidad,mt.usuarios,lg.pk,lg.usuario,lg.pass FROM methodlike MT,mlogin LG WHERE MT.FLG_EST = 1 AND (LG.SUBSCRIPCION = 1 or lg.flg_pp = 1) AND lg.flg_exp = 1;
END PRC_GET_TAREAS_EXPANCION;

PROCEDURE PRC_GET_PROXY
(
X_CURSOR OUT SYS_REFCURSOR
)
IS
BEGIN
OPEN X_CURSOR FOR
SELECT PR.ID_PROXY, PR.USERPROXY,PR.PASSPROXY,PR.ADDRESSPROXY,PR.PAIS,PR.CURRENT_TASK,PR.TAREA_PRIORIDAD FROM PROXY PR WHERE PR.CURRENT_TASK < PR.MAX_TASK AND ESTADO = 1; 
END PRC_GET_PROXY;

PROCEDURE PRC_GET_ALLPROXY
(
X_CURSOR OUT SYS_REFCURSOR
)
IS
BEGIN
OPEN X_CURSOR FOR
SELECT PR.ID_PROXY, PR.USERPROXY,PR.PASSPROXY,PR.ADDRESSPROXY,PR.PAIS,PR.CURRENT_TASK,PR.TAREA_PRIORIDAD FROM PROXY PR; 
END PRC_GET_ALLPROXY;
procedure prc_get_login
(
X_LIMIT IN NUMBER,
X_CURSOR OUT SYS_REFCURSOR
)
IS
BEGIN
OPEN X_CURSOR FOR 
SELECT * FROM(SELECT * FROM tareas_login_pend)WHERE ROWNUM < X_LIMIT;
END prc_get_login;

PROCEDURE prc_get_free_proxy
(
X_CURSOR OUT SYS_REFCURSOR
)
IS
X_CURRENT_PROXY number;
X_TOTAL_TASK number;
X_FREE_CONEX NUMBER;
BEGIN
OPEN x_cursor FOR
select SUM (SUM (proxy.max_task) - SUM (proxy.current_task)) AS X_FREE_CONEX  from proxy WHERE estado = 1;
END prc_get_free_proxy;
END PKG_API_CONS;

